import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useLocation } from "react-router-dom";
import "./login.css";
import {
  Avatar,
  Button,
  CssBaseline,
  TextField,
  FormControl,
  FormControlLabel,
  Checkbox,
  FormHelperText,
  Grid,
  Box,
  Typography,
  Container,
} from '@mui/material/';
import { createTheme, ThemeProvider } from '@mui/material/styles';


function Login({ getUserInfo, updateUserInfo }) {
  const theme = createTheme();
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const navigate = useNavigate()
  const location = useLocation();
  console.log(location)

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Perform login logic here, e.g., send email and password to an API for authentication
    console.log("Email:", email);
    console.log("Password:", password);
    updateUserInfo(
      {
        id: 0,
        email: email,
        password: password,
        solvedCodingProblems: [1, 4, 5],
        solvedEthicsProblems: [0, 4, 9, 11],
      }
    );
    navigate("/selection");
  };

  return (
    <ThemeProvider theme={theme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: '#3c407f' }} />
          <Typography component="h1" variant="h5">
            회원가입
          </Typography>
          <Box noValidate sx={{ mt: 3 }}>
            <FormControl component="fieldset" variant="standard">
              <Grid container spacing={2}>
                <Grid item xs={12}>
                  <TextField
                    required
                    autoFocus
                    fullWidth
                    type="email"
                    id="email"
                    name="email"
                    label="이메일 주소"
                  />
                  <Box sx={{ display: 'flex', justifyContent: 'center', mt: 2 }}>
                    <Button variant="contained" onClick={duplicateHandler}>
                      중복 검사
                    </Button>
                  </Box>
                  {duplicatePopup && <div style={{ color: 'red' }}>* 중복된 이메일입니다.</div>} {/* 중복 에러 표시 */}
                  {successPopup && <div style={{ color: 'red' }}>* 성공했습니다.</div>} {/* 성공 팝업 표시 */}
                </Grid>

                <Grid item xs={12}>
                  <TextField
                    required
                    fullWidth
                    type="password"
                    id="password"
                    name="password"
                    label="비밀번호 (8자리 이상 16자리 이하)"
                    onChange={handlePasswordChange}
                  />
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    required
                    fullWidth
                    type="password"
                    id="password2"
                    name="password2"
                    label="비밀번호 재입력"
                    onChange={handlePassword2Change}
                  />
                </Grid>

              </Grid>
            </FormControl>
          </Box>
        </Box>
        <Box sx={{ display: 'flex', justifyContent: 'center', mt: 2, }}>
          <Button variant="contained" onClick={handleSubmit}>
            제출
          </Button>
        </Box>
        {failure3Popup && <div style={{ color: 'red' }}>* 조건에 맞는 비밀번호를 입력해주세요.</div>} {/* 실패 팝업 표시 */}
        {failure2Popup && <div style={{ color: 'red' }}>* 이메일 중복 확인을 한 후 제출 버튼을 눌러주세요.</div>} {/* 실패 팝업 표시 */}
        {failurePopup && <div style={{ color: 'red' }}>* 비밀번호와 비밀번호 확인이 일치하지 않습니다.</div>} {/* 실패 팝업 표시 */}

      </Container>
    </ThemeProvider>
  );
}

export default Login;
